import React from "react";
import useFetch from "../useFetch";

const About = () => {
  const { comments } = useFetch("https://jsonplaceholder.typicode.com/users");

  return (
    <div className="container">
      <h1>About</h1>
      {comments.map((index) => (
        <div key={index.id}>
          <p>name :{index.name}</p>
        </div>
      ))}

      {/* {users && <p>{users.title}</p>} */}
    </div>
  );
};

export default About;
